import React from 'react';
import './App.css';
import Car from './Car';

class App extends React.Component {
  render() {

    const brand = "Mercedes";

    return (
      <div>
        <Car brand={ brand } />
        <CarPrice/>
      </div>
    )
  }
}


class CarPrice extends React.Component {
  render() {
    return <p> {this.props.price} </p>
  }
}


export default App;
